import React from "react";

const Teste = () => {
  const array1 = [
    {
      id: "5",
      idAntigo: "4",
      desc: "bananas",
    },
    {
      id: "4",
      idAntigo: "2",
      desc: "arroz",
    },
    {
      id: "3",
      idAntigo: "0",
      desc: "massa",
    },
    {
      id: "2",
      idAntigo: "0",
      desc: "salsichas",
    },
    {
      id: "1",
      idAntigo: "0",
      desc: "rojoes",
    },
  ];
  const array2 = [
    {
      id: "5",
      idAntigo: "4",
      desc: "bananas",
    },
    {
      id: "4",
      idAntigo: "2",
      desc: "arroz",
    },
    {
      id: "3",
      idAntigo: "0",
      desc: "massa",
    },
    {
      id: "2",
      idAntigo: "0",
      desc: "salsichas",
    },
    {
      id: "1",
      idAntigo: "0",
      desc: "rojoes",
    },
  ];

  const remove = (arra1, arra2) => {
    for (var ar1 of array1) {
      for (var ar2 of array2) {
        if (ar1.idAntigo === ar2.id) {
          array2.splice(array2.indexOf(ar2), 1);
        }
      }
    }
    return array2;
  };

  return (
    <div style={{ margin: "auto" }}>
      {array2.map((a) => (
        <h1>{a.desc}</h1>
      ))}
    </div>
  );
};

export default Teste;
